    lines = stdin.strip().split('\n')
    n = int(lines.pop(0))
    segments = []

    for i in range(n):
        l, r = map(int, lines[i].strip().split())
        segments.append((l, r))

    segments.sort()

    def segment_intersection(s1: tuple[int, int], s2: tuple[int, int]) -> tuple[int, int]:
        if s1[0] > s2[1] or s2[0] > s1[1]:
            return (0, 0)

        if s1[0] >= s2[0] and s1[1] <= s2[1]:
            return s1
        elif s2[0] >= s1[0] and s2[1] <= s1[1]:
            return s2

        return (max(s1[0], s2[0]), min(s1[1], s2[1]))

    def max_segment_intersection(segments: list[tuple[int, int]]) -> int:
        result = 0
        i = 0
        j = 1

        while j < len(segments):
            s1 = segments[i]
            s2 = segments[j]
            intersection = segment_intersection(s1, s2)

            if intersection[0] > 0:
                result = max(result, intersection[1] - intersection[0] + 1)
            i += 1
            j += 1

        return result

    max_length = max_segment_intersection(segments)
    return str(max_length)

