            return 'Invalid Input'

    def evaluate(expr, index=0, sign=1):
        if index == len(expr):
            return sign
        operand = expr[index]
        if sign == 1:
            if operand >= 0:
                return evaluate(expr, index + 1, sign)
            else:
                sign *= -1
                return evaluate(expr, index + 1, sign)
        else:
            if operand >= 0:
                sign *= -1
