        u_root = find(parent, u)
        v_root = find(parent, v)
        if u_root == v_root:
            return False
        if rank[u_root] > rank[v_root]:
            parent[u_root] = v_root
        elif rank[u_root] < rank[v_root]:
            parent[v_root] = u_root
        else:
            parent[v_root] = u_root
            rank[u_root] += 1
            return True

    def calculate_mst_weight(edges):
        mst_weight = 0
        parent = [i for i in range(n)]
        rank = [0] * n

        for i in range(n):
            min_edge = edges[i]
            u = min_edge[0]
            v = min_edge[1]
            w = min_edge[2]

            if not union(parent, rank, u, v):
                mst_weight += w
                u_root = find(parent, u)
                for j in range(i):
                    min_j_edge = edges[j]
                    u_j = min_j_edge[0]
                    v_j = min_j_edge[1]
                    w_j = min_j_edge[2]
                    if u_j == u_root or v_j == u_root:
