    def has_cycle(head: ListNode, pos: int) -> bool:
        slow = head
        fast = head
        count = 0

        while fast and fast.next:
            slow = slow.next
            fast = fast.next.next

            if slow == fast:
                count += 1
                if count == pos:
                    return True

        return False

    class ListNode:
        def __init__(self, x):
            self.val = x
            self.next = None

    def string_to_list(s: str) -> ListNode:
        if not s:
            return None

        head = ListNode(int(s[0]))
        current = head
        for i in range(1, len(s)):
            current.next = ListNode(int(s[i]))
            current = current.next

        return head

    def list_to_string(head: ListNode) -> str:
        if not head:
            return ""

        result = []
        current = head
        while current:
            result.append(str(current.val))
            current = current.next

        return " -> ".join(result)

    def main(stdin: str) -> str:
        head = string_to_list(stdin)
        pos = int(stdin.split()[1])
        result = "true" if has_cycle(head, pos) else "false"

        return result

    return main(stdin)

