    n, k = map(int, stdin.split())
    samples = [list(map(str.upper, stdin.strip())) for _ in range(n)]

    def count_matching_edges(tree: str, edges: Set[Tuple[int, int]]) -> int:
        return sum(tree.count(f"{edge[0]} - {edge[1]}") for edge in edges)

    def dfs(tree: str, u: int, visited: List[bool], edges: Set[Tuple[int, int]]) -> List[int]:
        visited[u] = True
        for v in range(n):
            if not visited[v]:
                if tree[u]!= tree[v]:
                    edges.add((u, v))
                    tree = tree[:u] + " - " + tree[u:v] + " - " + tree[v:] + " - " + tree[u+1:]
        return tree

    def min_unlikeliness(tree: str, unlikes: List[int]) -> int:
        return min(unlikes)

    def backtrack(tree: str, visited: List[bool], edges: Set[Tuple[int, int]], unlikes: List[int]) -> str:
        if count_matching_edges(tree, edges) == len(unlikes) - 1:
            return tree
        for u in range(n):
            if not visited[u]:
                new_tree = dfs(tree, u, visited.copy(), edges)
                unlikes[u] = min_unlikeliness(new_tree, unlikes)
                result = backtrack(new_tree, visited, edges, unlikes)
                if result:
                    return result
        return None

    unlikes = [float('inf')] * n
    root = "".join(sorted(set(sum(samples, []))))
    result = backtrack(root, [False] * n, set(), unlikes)
    if result:
        unlikes = [unlikes.index(u) for u in unlikes]
        return str(min_unlikeliness(result, unlikes))
    else:
        return str(min_unlikeliness(root, unlikes))

