        nx, ny = x + dx, y + dy
        if 0 <= nx < H and 0 <= ny < W and not has_wall(nx, ny):
            return nx, ny
        return x, y

    gold = find_gold(H // 2, W // 2)
    traps = find_traps(H // 2, W // 2)

    direction = 0
    steps = 0
    risk_level = 0

    while gold:
        x, y = H // 2, W // 2
        dx, dy = 0, 0

        if direction == 0:
            dx, dy = 1, 0
        elif direction == 1:
            dx, dy = 0, 1
        elif direction == 2:
            dx, dy = -1, 0
        elif direction == 3:
            dx, dy = 0, -1

        x, y = move(x, y, dx, dy)

